@SuppressWarnings("unchecked")
public void init(NamedList args) {

  Object obj = args.remove("fieldName");
  if (null != obj) {
    fieldName = obj.toString();
  }

  if (0 < args.size()) {
    throw new SolrException(SERVER_ERROR,
        "Unexpected init param(s): '" +
            args.getName(0) + "'");
  }
}

